      ]
    },
  ];
  
function IndexBodyWeb()
{
    const ListSP= SP.map(function(item){
        return (
          <Loai_San_Pham data={item}/>
      );
      });

      return(
        <>
        {ListSP};
        </>
      )
}

export default IndexBodyWeb;
